import Sidebar from './Sidebar';

//home section components
import Bartop from './Bartop';

import MoviesHome from './Components/MoviesHome';
import Popular from './Components'

//body structure css
import './App.css';

class App extends Component {
    constructor(props){
        super(props);
        this.state={
            'app': [<MoviesHome />, ],
        }
    }
    
    HandleTabClick = (index) =>{
        console.log(index);
    }
    
    render(){
        return(
            <div id='app'>
                <Sidebar HandleTabClick={this.HandleTabClick}/>
                <div id='mainContent'>
                    <Bartop />
                    <MoviesHome />
                </div>
            </div>
        )
    }
}

export default App;
